eval("__webpack_require__.r(__webpack_exports__);\n// Ordinarily, you'd generate this data from markdown files in your\n// repo, or fetch them from a database of some kind. But in order to\n// avoid unnecessary dependencies in the starter template, and in the\n// service of obviousness, we're just going to leave it here.\n\n// This file is called `_posts.js` rather than `posts.js`, because\n// we don't want to create an `/blog/posts` route — the leading\n// underscore tells Sapper not to do that.\n\nconst posts = [\n\t{\n\t\ttitle: 'What is Sapper?',\n\t\tslug: 'what-is-sapper',\n\t\thtml: `\n\t\t\t<p>First, you have to know what <a href='https://svelte.dev'>Svelte</a> is. Svelte is a UI framework with a bold new idea: rather than providing a library that you write code with (like React or Vue, for example), it's a compiler that turns your components into highly optimized vanilla JavaScript. If you haven't already read the <a href='https://svelte.dev/blog/frameworks-without-the-framework'>introductory blog post</a>, you should!</p>\n\n\t\t\t<p>Sapper is a Next.js-style framework (<a href='blog/how-is-sapper-different-from-next'>more on that here</a>) built around Svelte. It makes it embarrassingly easy to create extremely high performance web apps. Out of the box, you get:</p>\n\n\t\t\t<ul>\n\t\t\t\t<li>Code-splitting, dynamic imports and hot module replacement, powered by webpack</li>\n\t\t\t\t<li>Server-side rendering (SSR) with client-side hydration</li>\n\t\t\t\t<li>Service worker for offline support, and all the PWA bells and whistles</li>\n\t\t\t\t<li>The nicest development experience you've ever had, or your money back</li>\n\t\t\t</ul>\n\n\t\t\t<p>It's implemented as Express middleware. Everything is set up and waiting for you to get started, but you keep complete control over the server, service worker, webpack config and everything else, so it's as flexible as you need it to be.</p>\n\t\t`\n\t},\n\n\t{\n\t\ttitle: 'How to use Sapper',\n\t\tslug: 'how-to-use-sapper',\n\t\thtml: `\n\t\t\t<h2>Step one</h2>\n\t\t\t<p>Create a new project, using <a href='https://github.com/Rich-Harris/degit'>degit</a>:</p>\n\n\t\t\t<pre><code>npx degit \"sveltejs/sapper-template#rollup\" my-app\n\t\t\tcd my-app\n\t\t\tnpm install # or yarn!\n\t\t\tnpm run dev\n\t\t\t</code></pre>\n\n\t\t\t<h2>Step two</h2>\n\t\t\t<p>Go to <a href='http://localhost:3000'>localhost:3000</a>. Open <code>my-app</code> in your editor. Edit the files in the <code>src/routes</code> directory or add new ones.</p>\n\n\t\t\t<h2>Step three</h2>\n\t\t\t<p>...</p>\n\n\t\t\t<h2>Step four</h2>\n\t\t\t<p>Resist overdone joke formats.</p>\n\t\t`\n\t},\n\n\t{\n\t\ttitle: 'Why the name?',\n\t\tslug: 'why-the-name',\n\t\thtml: `\n\t\t\t<p>In war, the soldiers who build bridges, repair roads, clear minefields and conduct demolitions — all under combat conditions — are known as <em>sappers</em>.</p>\n\n\t\t\t<p>For web developers, the stakes are generally lower than those for combat engineers. But we face our own hostile environment: underpowered devices, poor network connections, and the complexity inherent in front-end engineering. Sapper, which is short for <strong>S</strong>velte <strong>app</strong> mak<strong>er</strong>, is your courageous and dutiful ally.</p>\n\t\t`\n\t},\n\n\t{\n\t\ttitle: 'How is Sapper different from Next.js?',\n\t\tslug: 'how-is-sapper-different-from-next',\n\t\thtml: `\n\t\t\t<p><a href='https://github.com/zeit/next.js'>Next.js</a> is a React framework from <a href='https://vercel.com/'>Vercel</a>, and is the inspiration for Sapper. There are a few notable differences, however:</p>\n\n\t\t\t<ul>\n\t\t\t\t<li>It's powered by <a href='https://svelte.dev'>Svelte</a> instead of React, so it's faster and your apps are smaller</li>\n\t\t\t\t<li>Instead of route masking, we encode route parameters in filenames. For example, the page you're looking at right now is <code>src/routes/blog/[slug].svelte</code></li>\n\t\t\t\t<li>As well as pages (Svelte components, which render on server or client), you can create <em>server routes</em> in your <code>routes</code> directory. These are just <code>.js</code> files that export functions corresponding to HTTP methods, and receive Express <code>request</code> and <code>response</code> objects as arguments. This makes it very easy to, for example, add a JSON API such as the one <a href='blog/how-is-sapper-different-from-next.json'>powering this very page</a></li>\n\t\t\t\t<li>Links are just <code>&lt;a&gt;</code> elements, rather than framework-specific <code>&lt;Link&gt;</code> components. That means, for example, that <a href='blog/how-can-i-get-involved'>this link right here</a>, despite being inside a blob of HTML, works with the router as you'd expect.</li>\n\t\t\t</ul>\n\t\t`\n\t},\n\n\t{\n\t\ttitle: 'How can I get involved?',\n\t\tslug: 'how-can-i-get-involved',\n\t\thtml: `\n\t\t\t<p>We're so glad you asked! Come on over to the <a href='https://github.com/sveltejs/svelte'>Svelte</a> and <a href='https://github.com/sveltejs/sapper'>Sapper</a> repos, and join us in the <a href='https://svelte.dev/chat'>Discord chatroom</a>. Everyone is welcome, especially you!</p>\n\t\t`\n\t}\n];\n\nposts.forEach(post => {\n\tpost.html = post.html.replace(/^\\t{3}/gm, '');\n});\n\n/* harmony default export */ __webpack_exports__[\"default\"] = (posts);\n\n\n//# sourceURL=webpack:///./src/routes/blog/_posts.js?");

